function AdminAlerts({ setAlerts }) {
  const [done, setDone] = useState(false);

  const toggle = useCallback(() => {
    if (done) {
      setDone(false);
      setAlerts(3);
    } else {
      setDone(true);
      setAlerts(2);
    }
  }, [done, setAlerts]);

  return (
    <div className="alerts-body" onClick={toggle}>
      { done ? <AdminAlertsDone /> : <AdminAlertsBefore /> }
    </div>
  )
}

export default AdminAlerts;
